INSERT INTO `content_data` VALUES (1,'rockpad_estimate_economy','Economy description text for RockPads','This foundation eliminates the 4\" 6\" pressure-treated border, the weed fabric and the rebar. It will be filled in with 5-6 inches of #5 clean stone which helps for quick drainage and insures that your structure remains level on top of the stone base.','2012-03-26 20:40:17','2012-03-26 20:40:17'),(2,'rockpad_estimate_standard','Standard Description Text for Rockpads','Excavation of area ensures that the top of the foundation will be even with the ground where the entrance of the structure will be located. 4\" 6\" pressure treated timbers are used for the border. \" 2\' rebar secures the border to the ground. Geotextile fabric is used to eliminate weed growth around the structure. The soil will be compacted to eliminate settling. This area will be filled in with 5-6 inches of #5 clean stone which helps for quick drainage and insures that your structure remains level on top of the stone base.','2012-03-26 20:40:38','2012-03-26 20:40:38'),(3,'rockpad_estimate_elite','Elite Description text for Rockpads','Excavation of area ensures that the top of the foundation will be even with the ground where the entrance of the structure will be located. 4\" 6\" pressure treated timbers are used for the border with 1\" 6\" Trex-composite capping on top of the border to enhance the beauty and extend the durability of the border.  \" 2\' rebar secures the border to the ground. Geotextile fabric is used to eliminate weed growth around the structure. The soil will be compacted to eliminate settling. This area will be filled in with 5-6 inches of #5 clean stone which helps for quick drainage and insures that your structure remains level on top of the stone base.','2012-03-26 20:41:00','2012-03-26 20:41:00'),(4,'rockpad_estimate_custom','Custom Description text for Rockpads','This foundation eliminates the 4\" 6\" pressure-treated border, the weed fabric and the rebar. The soil will be compacted to eliminate settling. It will be filled in with 5-6 inches of #5 clean stone which helps for quick drainage and insures that your structure remains level on top of the stone base.','2012-03-26 20:41:21','2012-03-26 20:41:21'),(5,'','swingset','6x6 pressure treated timber border secured to the ground with 1/2\"x2 rebar,\r\nGeotextile fabric eliminates weed groweth, certified playground mulch, drainage system keeps the area from puddling. Excavation of site.','2012-04-19 22:49:55','2012-04-19 22:49:55'),(7,'concrete_gibraltar','CMS data for gibraltar','EXCAVATION DIG DOWN BELOW FROST LINE.   8\'\' DEEP X2\' WIDE  CONCRETE FOOTER 3500 PSI CONCRETE STRENGTH, REINFORCED WITH 2 ROWS OF #4 REBAR , CEMENT BLOCK WALLS BUILT UP TO 6 TO 8\'\' ABOVE SUB GRADE.\r\nCONCRETE SLAB\r\n4\'\' #5 CLEAN STONE FOR SUB BASE, #4 REBAR EVERY 2\' SQUARE TO REIFORCE CONCRETE SLAB, VAPOR BARRIER HELPS ELIMINATE MOISTURE, 4\'\' 3500 PSI CONCRETE SLAB, SMOOTH SURFACE. ','2012-05-14 18:39:36','2012-06-25 15:54:31'),(8,'concrete_floating_slab','CMS data for floating slab','EXCAVATION OF SOIL, 4\'\' #5 CLEAN STONE FOR DRAINAGE, #4 REBAR EVERY 2\' SQUARE FOR REINFORCEMENT, VAPIOR BARRIER ELIMINATES MOISTURE,  CONCRETE SLAB 3500 PSI, ','2012-05-14 18:41:59','2012-07-02 19:25:23'),(9,'concrete_graduated_slab','CMS data for graduated slab	','EXCAVATION AND LEVELIING OF SITE, TRENCH AROUND PERIMATER OF FOUNDATION, \r\n8\'\' WIDE THICKENED EDGE, REINFORCED WITH #4 REBAR, TAPERING UP TO MEET THE 4\'\' CONCRETE SLAB 3500 PSI.\r\n4\'\' #5 CLEAN STONE TO INSURE PROPER DRAINAGE. VAPIOR BARRIER ELIMINATES MOISTURE, #4 REBAR EVERY 2\' SQUARE FOR ADDITIONAL SUPPORT.\r\nSMOOTH FINISH CONCRETE SLAB,\r\n.BACKFILL AND GRADING.','2012-05-14 18:42:25','2012-06-25 22:38:26'),(10,'concrete_piers','CMS data for concrete piers','Concrete piers are for the weak. They are used for docking boats','2012-05-14 18:43:06','2012-07-02 19:36:35');
